import{_ as a,c as r,o as n,ag as t}from"./chunks/framework.Ds6Eueu6.js";const c=JSON.parse('{"title":"About the WarehousePG Release Version Number","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/admin_guide/managing/versioning.md","filePath":"docs/7x/admin_guide/managing/versioning.md"}'),o={name:"docs/7x/admin_guide/managing/versioning.md"};function i(s,e,u,h,l,m){return n(),r("div",null,e[0]||(e[0]=[t('<h1 id="about-the-warehousepg-release-version-number" tabindex="-1">About the WarehousePG Release Version Number <a class="header-anchor" href="#about-the-warehousepg-release-version-number" aria-label="Permalink to &quot;About the WarehousePG Release Version Number&quot;">â€‹</a></h1><hr><p>WarehousePG version numbers and the way they change identify what has been modified from one WarehousePG release to the next.</p><p>A WarehousePG release version number takes the format x.y.z, where:</p><ul><li>x identifies the Major version number</li><li>y identifies the Minor version number</li><li>z identifies the Patch version number</li></ul><p>WarehousePG releases that have the same Major release number are guaranteed to be backwards compatible. WarehousePG increments the Major release number when the catalog changes or when incompatible feature changes or new features are introduced. Previously deprecated functionality may be removed in a major release.</p><p>The Minor release number for a given Major release increments when backwards compatible new features are introduced or when a WarehousePG feature is deprecated. (Previously deprecated functionality will never be removed in a minor release.)</p><p>WarehousePG increments the Patch release number for a given Minor release for backwards-compatible bug fixes.</p><p><strong>Parent topic:</strong> <a href="./../managing/managing.html">Managing a WarehousePG cluster</a></p>',9)]))}const b=a(o,[["render",i]]);export{c as __pageData,b as default};
